	add("facility", "{\"term\":\"facility\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027facilité\u0027 and its source, Latin {{m|la|facilitās}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of being easy, or easily done; absence of difficulty, simplicity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Clytomachus\u0027 affirmed, that he could never understand by the writings of \u0027Carneades\u0027, what opinion he was of. Why hath \u0027Epicurus\u0027 interdicted \u0027\u0027facility\u0027\u0027 unto his Sectaries\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dexterity of speech or action; skill, talent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027facility\u0027\u0027 she shows in playing the violin is unrivalled\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The physical means or contrivances to make something (especially a public service) possible; the required equipment, infrastructure, location etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Transport \u0027\u0027facilities\u0027\u0027 in Bangkok are not sufficient to prevent frequent traffic collapses during rush hour\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL4103950W Internal passage\u003dAs though on an incendiary rampage, the fires systematically devoured the contents of Edison\u0027s headquarters and \u0027\u0027facilities\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A toilet\", \"priority\":9}]}, \"synonyms\":{}}");

