	add("factiness", "{\"term\":\"factiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|facty|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being full of, or solely concerned with, fact\", \"priority\":1}]}, \"synonyms\":{}}");

