	add("factor", "{\"term\":\"factor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027facteur\u0027 from Latin \u0027factor\u0027 (a doer, maker, performer) from \u0027factus\u0027 (done or made) perfect passive participle of {{m|la|faciō||do, make}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doer, maker; a person who does things for another person or organization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An agent or representative\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027factor\u0027\u0027 sends me word, a merchant\u0027s fled / That owes me for a hundred tun of wine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"II.21\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And let such as will number the Kings of Castile and Portugall amongst the warlike and magnanimous conquerors, seeke for some other adherent then my selfe, forsomuch as twelve hundred leagues from their idle residence they have made themselves masters of both Indias, onely by the conduct and direction of their \u0027\u0027factors\u0027\u0027, of whom it would be knowne whether they durst but goe and enjoy them in person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What does he therefore, but resolvs to give over toyling, and to find himself out som \u0027\u0027factor\u0027\u0027, to whose care and credit he may commit the whole managing of his religious affairs; som Divine of note and estimation that must be\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A commission agent\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person or business organization that provides money for another\u0027s new business venture; one who finances another\u0027s business\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A business organization that lends money on accounts receivable or buys and collects accounts receivable\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"One of the elements, circumstances, or influences which contribute to produce a result\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the material and dynamical \u0027\u0027factors\u0027\u0027 of nutritio\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Any of various objects multiplied together to form some whole\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027, \u0027\u0027, p.38\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The first thousand primesmarched in order before himthe complete sequence of all those numbers that possessed no \u0027\u0027factors\u0027\u0027 except themselves and unity\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Influence; a phenomenon that affects the nature, the magnitude, and/or the timing of a consequence\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dSimilar studies of rats have employed four different intracranial resorbable, slow sustained release systems\u0026amp;mdash;\u0026amp;nbsp;[\u0026amp;hellip;]. Such a slow-release device containing angiogenic \u0027\u0027factors\u0027\u0027 could be placed on the pia mater covering the cerebral cortex and tested in persons with senile dementia in long term studies\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A resource used in the production of goods or services, a factor of production\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579860-g8-pledges-tackle-three-ts-t-time T passage\u003dThe ability to shift profits to low-tax countries by locating intellectual property in themis often assumed to be the preserve of high-tech companies.current tax rules make it easy for all sorts of firms to generate“stateless income”: profit subject to tax in a jurisdiction that is neither the location of the \u0027\u0027factors\u0027\u0027 of production that generate the income nor where the parent firm is domiciled\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A steward or bailiff of an estate\", \"priority\":19}]}, \"synonyms\":{}}");

	add("factorial", "{\"term\":\"factorial\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The result of multiplying a given number of consecutive integers from 1 to the given number. In equations, it is symbolized by an exclamation mark (!). For example, 5! \u003d 1 * 2 * 3 * 4 * 5 \u003d 120\", \"priority\":1}]}, \"synonyms\":{}}");

	add("factory", "{\"term\":\"factory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027factorie\u0027 from \u0027factoria\u0027 from Latin \u0027factor\u0027 Compare Italian \u0027fattoria\u0027 Spanish \u0027factoría\u0027 Portuguese \u0027feitoria\u0027 Dutch \u0027{{l|nl|factorij}}\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A trading establishment, especially set up by merchants working in a foreign country\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The position or state of being a factor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A building or other place where manufacturing takes place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003d[…] St. Bede\u0027s at this period of its history was perhaps the poorest and most miserable parish in the East End of London. Close-packed, crushed by the buttressed height of the railway viaduct, rendered airless by huge walls of \u0027\u0027factories\u0027\u0027, it at once banished lively interest from a stranger\u0027s mind and left only a dull oppression of the spirit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe highway to the East Coast which ran through the borough of Ebbfield had always been a main road and even now, despite the vast garages, the pylons and the gaily painted \u0027\u0027factory\u0027\u0027 glasshouses which had sprung up beside it, there still remained an occasional trace of past cultures\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A device which produces or manufactures something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In a computer program or library, a function, method, etc. which creates an object\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sayed Ibrahim Hashimi, William Bartholomew, \u0027Inside the Microsoft Build Engine\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The task \u0027\u0027factory\u0027\u0027 is the object that is responsible for creating instances of those tasks dynamically\", \"priority\":9}]}, \"synonyms\":{}}");

	add("factotum", "{\"term\":\"factotum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027factotum\u0027 (lit\u003ddo everything) from Latin \u0027fac\u0027 present singular imperative of {{m|la|faciō||do, make}} + {{m|la|tōtum||everything}}; attested in English from 1566.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person having many diverse activities or responsibilities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A general servant\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, w:Herman Herman Melville, Omoo\u0027, Chapter 73\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I had almost forgotten Monee, the grinning old man who prepared our meal. […] He was Po-Po’s \u0027\u0027factotum\u0027\u0027—cook, butler, and climber of the bread-fruit and cocoa-nut trees; and, added to all else, a mighty favourite with his mistress; with whom he would sit smoking and gossiping by the hour\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A jack of all trades\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An individual employed to do all sorts of duties\", \"priority\":6}]}, \"synonyms\":{}}");

